import React from 'react'

import './Nav.css'
import Video from './Video'

export const AdminVideo = ({state}) => {

    console.log(sta)
    const allVideo=Object.keys(state.video)
                .map(items =>{console.log(items , state.video.items)
                    return
                    <Video key={items} video={state.video.items}/>
                })
   
    return (
        <div className='cards'>
           {allVideo}
        </div>
    )
}


export default AdminVideo
